import React from 'react';



const Hero = (props) =>{

    const {handleLogout, key} = props;

    return(
        <section className="hero">
            <nav>

            <h2>{props.key}</h2>

            <button onClick={handleLogout}>Logout</button>
            </nav>    
        </section>    
    );

};
export default Hero;
